import classes from './MealsSummary.module.css';

const MealsSummary = () =>{
    return (
        <section className={classes.summary}>
            <h2>Big Burgers</h2>
            <p>Greasy, sloppy, messy and probably chest pain inducing burgers delivered straight to your door!</p>
            <p>100% pure taste to fill that hole in your stomach. Just what the doctor ordered!</p>
        </section>
    )
}

export default MealsSummary;
